import one from '../src/img/3.svg';
import two from '../src/img/2.svg';
import three from '../src/img/3.svg';
import four from '../src/img/4.svg';
import five from '../src/img/2.svg';
import six from '../src/img/3.svg';

const Sdata = [
    {
        imgsrc : one,
        bold : "Web Development"
    },
    {
        imgsrc : two,
        bold : "Android Development",
    },
    {
        imgsrc : three,
        bold : "Software Quality Assurance",
    },
    {
        imgsrc : four,
        bold : "UI/UX Design",
    },
    {
        imgsrc : five,
        bold : "Graphics Design",
    },
    {
        imgsrc : six,
        bold : "Visualizer",
    },
];

export default Sdata;
